import random
import time
import tkinter
string=""""""
working=False
def to_str(n,d):
    num = str(n)[1:]
    chunks = [num[i:i+3] for i in range(0, len(num), 3)]
    return "".join(map(lambda a: chr(int(a)//d), chunks))
while not working:
    string2=to_str(string,random.randint(1,16))
    try:
        working=True
        exec(string2)
    except:
        working=False

